import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 59.1-507.5 Copy; contract with previous vested grant of rights.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-507.5.md","filePath":"vacode/59.1-507.5.md"}'),o={name:"vacode/59.1-507.5.md"},c=r('<h1 id="§-59-1-507-5-copy-contract-with-previous-vested-grant-of-rights" tabindex="-1">§ 59.1-507.5 Copy; contract with previous vested grant of rights. <a class="header-anchor" href="#§-59-1-507-5-copy-contract-with-previous-vested-grant-of-rights" aria-label="Permalink to &quot;§ 59.1-507.5 Copy; contract with previous vested grant of rights.&quot;">​</a></h1><p>If an agreement grants a right in or permission to use informational rights which precedes or is otherwise independent of the delivery of a copy, the following rules apply:</p><p>(1) A party may refuse a tender of a copy which is a material breach as to that copy, but refusal of that tender does not cancel the contract.</p><p>(2) In a case governed by paragraph (1), the tendering party may cure the breach by seasonably providing a conforming copy before the breach becomes material as to the whole contract.</p><p>(3) A breach that is material with respect to a copy allows cancellation of the contract only if the breach cannot be seasonably cured and is a material breach of the whole contract.</p><p>2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0101" target="_blank" rel="noreferrer">101</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0996" target="_blank" rel="noreferrer">996</a>.</p>',6),n=[c];function i(s,h,p,l,d,f){return t(),a("div",null,n)}const v=e(o,[["render",i]]);export{g as __pageData,v as default};
